import React, { useState } from 'react';
import { InputText } from 'primereact/inputtext';
import { Button } from 'primereact/button';
import '../Css/Login.css';


const Login = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    return (
        <div className="login-wrapper">
            <div className="nav">
                <div className="logo">
                    <i className="pi pi-plus-circle"></i>
                </div>
                <div className="nav-links">
                    <a href="#" className="nav-link">Home</a>
                    <a href="#" className="nav-link">Our products</a>
                    <a href="#" className="nav-link">About US</a>
                    <a href="#" className="nav-link">Contact US</a>
                </div>
                <Button label="Join" className="join-btn" />
            </div>

            <div className="login-container">
                <div className="login-section">
                    <div className="login-header">
                        <span className="active">Login</span>
                        <span className="inactive">Sign up</span>
                    </div>
                    
                    <div className="login-form">
                        <span className="p-input-icon-left">
                            <i className="pi pi-user" />
                            <InputText
                                value={email}
                                onChange={(e) => setEmail(e.target.value)}
                                placeholder="Email or phone number"
                            />
                        </span>

                        <span className="p-input-icon-left">
                            <i className="pi pi-lock" />
                            <InputText
                                type="password"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                                placeholder="Password"
                            />
                        </span>

                        <a href="#" className="forgot-link">Forgot your password?</a>

                        <Button label="Login" className="login-btn" />
                    </div>
                </div>
                <div className="image-section">
                    {/* Aquí va la imagen que proporcionarás */}
                    <img src="./img/Login" alt="Decorative" />
                </div>
            </div>
        </div>
    );
};

export default Login;
